1	Turbo	Turbo Ristorante	<div class="contract-content">\n<h1>CONTRATTO DI {{tipo_contratto}}</h1>\n\n<p><strong>Tra:</strong></p>\n<p>{{societa}} con sede in {{sede}}<br>\nP.IVA: {{p_iva}}<br>\nEmail: {{email}}<br>\nPEC: {{pec}}</p>\n\n<p><strong>E:</strong></p>\n<p>Il Sig./Sig.ra {{cliente_nome}}<br>\nEmail: {{cliente_email}}<br>\nTelefono: {{cliente_telefono}}</p>\n\n<h2>OGGETTO DEL CONTRATTO</h2>\n<p>Il presente contratto ha per oggetto la prestazione dei seguenti servizi...</p>\n\n<h2>BONUS INCLUSI</h2>\n<!-- BLOCK:BONUS_LIST -->\n<p> {{bonus_descrizione}}</p>\n<!-- END_BLOCK:BONUS_LIST -->\n\n<h2>PIANO DI PAGAMENTO</h2>\n<!-- BLOCK:PAYMENT_PLAN -->\n<p> Rata {{rata_numero}} di EUR {{rata_importo}} + IVA entro il {{rata_scadenza}}</p>\n<!-- END_BLOCK:PAYMENT_PLAN -->\n\n<h2>VALORE TOTALE</h2>\n<p>Il valore complessivo del presente contratto  di <strong>EUR {{prezzo_totale}}</strong> + IVA.</p>\n\n<h2>TERMINI E CONDIZIONI</h2>\n<p>Il presente contratto  regolato dalla legge italiana...</p>\n</div>	1	t	2025-06-27 17:37:10.681395	2025-06-28 01:21:06.336	[]	{"maxInstallments": 36, "allowInstallments": true, "paymentFrequencies": ["monthly", "quarterly", "annual"]}	<div style="line-height: 1.8; font-size: 16px; color: #333;">\n\n  <h2 style="text-align: center; font-size: 32px; margin-bottom: 20px;">Oggetto del Servizio: Piattaforma "Turbo"</h2>\n\n  <p>\n    Il presente contratto regola la fornitura di una <strong>licenza d'uso annuale</strong> per la piattaforma software "Turbo", un sistema operativo intelligente progettato specificamente per le attivit di ristorazione. Il servizio ha lo scopo di fornire al Cliente gli strumenti tecnologici per <strong>ottimizzare la gestione operativa</strong>, migliorare l'esperienza del cliente finale e implementare <strong>strategie di marketing e fidelizzazione</strong>.\n  </p>\n  \n  <p>\n    La licenza d'uso alla piattaforma "Turbo" include l'accesso ai seguenti moduli e funzionalit principali:\n  </p>\n  \n  <ul style="margin-bottom: 30px; padding-left: 20px;">\n    <li><strong>Modulo Fidelity "Calamita per Clienti":</strong> Strumenti per la creazione e la gestione di un programma di fidelizzazione automatico.</li>\n    <li><strong>Modulo Men Digitale "Cameriere Aumentato":</strong> Funzionalit per la creazione di un men interattivo con strumenti integrati di up-selling e cross-selling.</li>\n    <li><strong>Modulo Prenotazioni "Agenda Intelligente":</strong> Sistema per la gestione centralizzata delle prenotazioni online, volto a ottimizzare l'occupazione dei tavoli e a ridurre le mancate presentazioni.</li>\n    <li><strong>Dashboard di Analisi e Reportistica:</strong> Un pannello di controllo che fornisce dati aggregati su vendite e performance per supportare le decisioni strategiche.</li>\n  </ul>\n\n  <hr style="margin: 40px 0;">\n\n  <h1 style="text-align: center; font-size: 48px; margin-bottom: 40px;">BONUS</h1>\n\n  <p>\n    Il presente contratto include una serie di <strong>bonus esclusivi</strong> e \n    <strong>servizi di valore aggiunto</strong> che potenziano significativamente l'offerta base, \n    garantendo al cliente un <strong>pacchetto completo</strong> e una \n    <strong>strategia di crescita personalizzata</strong> per massimizzare i risultati dell'investimento.\n  </p>\n\n  <p>\n    Tutti i bonus inclusi sono stati progettati per <strong>eliminare le principali barriere</strong> che impediscono ai clienti di ottenere risultati immediati: \n    <em>mancanza di tempo, complessit tecnologica, incertezza sui risultati e necessit di supporto continuo</em>. \n    L'obiettivo  garantire un <strong>percorso di crescita guidato, sicuro e misurabile</strong> fin dal primo giorno.\n  </p>\n\n  <hr style="margin: 30px 0;">\n\n  <h3>BONUS #1: Setup Guidato "Pronti, Partenza, VIA!"</h3>\n  <ul style="margin-bottom: 30px;">\n    <li><strong>Obiettivo:</strong> Eliminare l'ostacolo del "non ho tempo" e della complessit iniziale.</li>\n    <li><strong>Cosa Include:</strong> Un nostro tecnico specializzato si collega con te e imposta l'80% della piattaforma al posto tuo: configurazione del men digitale, impostazioni di base dell'agenda, creazione della prima offerta per il programma fedelt. Ti consegniamo il sistema "chiavi in mano", pronto a generare risultati dalla prima settimana.</li>\n    <li><strong>Valore Percepito:</strong> Tranquillit, risparmio di tempo, risultati immediati. \n      <span style="color: green;"><strong>(Valore: 497)</strong></span>\n    </li>\n  </ul>\n\n  <h3>BONUS #2: Garanzia "Anti-Stress Tecnologico" con Formazione su Misura</h3>\n  <ul style="margin-bottom: 30px;">\n    <li><strong>Obiettivo:</strong> Eliminare la paura del "non sono bravo con la tecnologia" per il titolare e il suo staff.</li>\n    <li><strong>Cosa Include:</strong> Una sessione di formazione live dedicata e registrata per te e il tuo team. Mostriamo solo le 3-4 funzioni essenziali che userete ogni giorno. Se dopo una settimana ci sono ancora dubbi, la rifacciamo gratis.</li>\n    <li><strong>Valore Percepito:</strong> Semplicit, sicurezza, autonomia per tutto il team. \n      <span style="color: green;"><strong>(Valore: 797)</strong></span>\n    </li>\n  </ul>\n\n  <h3>BONUS #3: Piano di Crescita Personalizzato a 90 Giorni</h3>\n  <ul style="margin-bottom: 30px;">\n    <li><strong>Obiettivo:</strong> Dimostrare che la strategia funziona specificamente per il suo locale.</li>\n    <li><strong>Cosa Include:</strong> Una call strategica dedicata dopo l'impostazione iniziale per analizzare i tuoi numeri e definire insieme una roadmap su misura per il tuo ristorante, con obiettivi chiari e misurabili a 30, 60 e 90 giorni.</li>\n    <li><strong>Valore Percepito:</strong> Strategia su misura, chiarezza, fiducia nei risultati. \n      <span style="color: green;"><strong>(Valore: 1.497)</strong></span>\n    </li>\n  </ul>\n\n  <h3>BONUS #4: Acceleratore di Ritorno sull'Investimento (ROI)</h3>\n  <ul style="margin-bottom: 30px;">\n    <li><strong>Obiettivo:</strong> Rispondere alla domanda "come rientro dall'investimento?" e dimostrare subito la potenza del sistema.</li>\n    <li><strong>Cosa Include:</strong> Creeremo insieme a te, passo dopo passo, la tua primissima campagna di marketing usando il modulo Fidelity o Delivery. L'obiettivo  farti generare i primi incassi extra direttamente con il nostro aiuto.</li>\n    <li><strong>Valore Percepito:</strong> Risultati economici immediati, prova pratica del valore, riduzione del rischio. \n      <span style="color: green;"><strong>(Valore: 997)</strong></span>\n    </li>\n  </ul>\n\n  <h3>BONUS #5: Consulenza Strategica Mensile "Check-Point Crescita" (12 Consulenze)</h3>\n  <ul style="margin-bottom: 30px;">\n    <li><strong>Obiettivo:</strong> Garantire che il ristoratore non sia mai lasciato solo, che mantenga la rotta e massimizzi costantemente i risultati della piattaforma Turbo.</li>\n    <li><strong>Cosa Include:</strong> Una consulenza strategica individuale di 60 minuti ogni mese, per 12 mesi. Durante queste call, analizzeremo insieme a te i dati del mese precedente, identificheremo nuove opportunit di crescita (es. lanciare una nuova offerta, ottimizzare il men), risolveremo eventuali blocchi e imposteremo gli obiettivi per il mese successivo.  il tuo copilota strategico personale per la crescita del ristorante.</li>\n    <li><strong>Valore Percepito:</strong> Supporto continuo, responsabilit, strategia proattiva, massimizzazione dei risultati nel tempo. \n      <span style="color: green;"><strong>(Valore: Almeno 2.997)</strong></span>\n    </li>\n  </ul>\n\n</div>	<div style="line-height: 1.8; font-size: 16px; color: #333; margin-top: 30px;">\n\n  <p>\n    sar <strong>corrisposto mediante pagamento</strong> che il Cliente/Committente \n    avr cura di accendere come <strong>soluzione sottoscritta nel contratto</strong>, con conseguente \n    pagamento dell'indicato importo <strong>in ununica soluzione</strong> o <strong>a rate</strong>, \n    per come prestabilito nel contratto.\n  </p>\n\n  <p>\n    Resta inteso che, in caso di <strong>inerzia da parte del Cliente</strong>, potr essere emesso un \n    <strong>rimborso entro 30 giorni</strong> dalla firma del contratto e avvenuto pagamento.\n  </p>\n\n</div>
2	Orbitale	Orbitale	<div class="contract-content">\n\n<h2>TERMINI E CONDIZIONI</h2>\n<p>Il presente contratto  regolato dalla legge italiana...</p>\n</div>	1	t	2025-06-28 01:25:01.807243	2025-06-28 01:27:16.228	[]	{"maxInstallments": 36, "allowInstallments": true, "paymentFrequencies": ["monthly", "quarterly", "annual"]}	<div style="line-height: 1.8; font-size: 16px; color: #333;">\n\n  <h2 style="text-align: center; font-size: 32px; margin-bottom: 20px;">Oggetto del Servizio: Percorso "Orbitale"</h2>\n\n  <p>\n    Il presente contratto regola l'erogazione del percorso "Orbitale", un <strong>programma di alta formazione e consulenza strategica</strong> finalizzato a fornire al Cliente le competenze e gli strumenti per la gestione e la crescita del proprio patrimonio personale, con un focus specifico per imprenditori.\n\nSi specifica che il servizio "Orbitale" ha natura puramente formativa e di consulenza strategica e non costituisce in alcun modo consulenza finanziaria ai sensi del D.Lgs. 58/1998 (TUF), n sollecitazione al pubblico risparmio. Le decisioni finali di investimento e la loro esecuzione sono di esclusiva responsabilit del Cliente.\n  </p>\n  \n  <p>\n    Il servizio "Orbitale"  un percorso integrato che ha lo scopo di trasformare i profitti aziendali in <strong>ricchezza personale e rendite passive</strong>, costruendo un futuro finanziario solido e slegato dall'operativit quotidiana.\n  </p>\n  \n  <ul style="margin-bottom: 30px; padding-left: 20px;">\n    <li><strong>Percorso di Consulenza Individuale:</strong> Sessioni one-to-one con un esperto per definire un piano finanziario su misura.</li>\n    <li><strong>Accesso a Risorse Formative ("Accademia"):</strong> Materiale formativo digitale per acquisire competenze sulla finanza personale e gli investimenti.</li>\n    <li><strong>Licenza d'uso del Software "Orbitale Planner":</strong> Un cruscotto digitale per monitorare gli obiettivi e simulare la crescita patrimoniale.</li>\n  </ul>\n\n  <hr style="margin: 40px 0;">\n\n  <h1 style="text-align: center; font-size: 48px; margin-bottom: 40px;">BONUS ESCLUSIVI "ORBITALE"</h1>\n\n  <p>\n    Il percorso "Orbitale"  arricchito da una serie di <strong>bonus di altissimo valore</strong>, progettati per fornire un supporto completo e personalizzato nel viaggio verso la libert finanziaria.\n  </p>\n\n  <hr style="margin: 30px 0;">\n\n  <h3>BONUS #1: Il Piano "Libert Finanziaria 2K" Personalizzato (12 Consulenze)</h3>\n  <ul style="margin-bottom: 30px;">\n    <li><strong>Obiettivo:</strong> Trasformare i profitti extra del ristorante in una rendita passiva e sicura.</li>\n    <li><strong>Cosa Include:</strong> 12 consulenze individuali e dedicate con un nostro ESPERTO FINANZIARIO. Insieme, costruirete il piano strategico per raggiungere l'obiettivo di 2000 (o pi) di rendita passiva, analizzando la strategia di estrazione profitti, il profilo di rischio e le migliori opzioni di investimento.</li>\n    <li><strong>Valore Percepito:</strong> Un piano concreto per la libert finanziaria, guida esperta, sicurezza per il futuro.\n      <span style="color: blue;"><strong>(Valore: Almeno 4.997)</strong></span>\n    </li>\n  </ul>\n\n  <h3>BONUS #2: Accesso al Software di Pianificazione Finanziaria "Orbitale Planner"</h3>\n  <ul style="margin-bottom: 30px;">\n    <li><strong>Obiettivo:</strong> Dare uno strumento semplice per tracciare e visualizzare la crescita patrimoniale.</li>\n    <li><strong>Cosa Include:</strong> Un cruscotto digitale personale dove puoi monitorare ogni passo verso la libert finanziaria, pianificare le prossime mosse e proiettare la crescita del tuo patrimonio nel tempo.</li>\n    <li><strong>Valore Percepito:</strong> Controllo, chiarezza, motivazione nel vedere i progressi.\n      <span style="color: blue;"><strong>(Valore: 1.997)</strong></span>\n    </li>\n  </ul>\n\n  <h3>BONUS #3: Accesso all'Accademia "Ristoratore Investitore"</h3>\n  <ul style="margin-bottom: 30px;">\n    <li><strong>Obiettivo:</strong> Fornire la competenza finanziaria necessaria in modo semplice e mirato.</li>\n    <li><strong>Cosa Include:</strong> Una formazione online chiara e pratica, pensata per chi viene dal mondo della ristorazione, per prendere decisioni finanziarie intelligenti.</li>\n    <li><strong>Valore Percepito:</strong> Competenza, fiducia nelle proprie decisioni, demistificazione della finanza.\n      <span style="color: blue;"><strong>(Valore: 997)</strong></span>\n    </li>\n  </ul>\n\n  <h3>BONUS #4: I Simulatori di Crescita Patrimoniale</h3>\n  <ul style="margin-bottom: 30px;">\n    <li><strong>Obiettivo:</strong> Rendere tangibile e visibile il futuro finanziario.</li>\n    <li><strong>Cosa Include:</strong> Strumenti interattivi per "giocare" con gli scenari e visualizzare l'impatto delle decisioni di risparmio e investimento sul proprio percorso.</li>\n    <li><strong>Valore Percepito:</strong> Visione chiara del futuro, capacit di prendere decisioni migliori, motivazione.\n      <span style="color: blue;"><strong>(Valore: 497)</strong></span>\n    </li>\n  </ul>\n\n</div>	<div style="line-height: 1.8; font-size: 16px; color: #333; margin-top: 30px;">\n\n  <p>\n    sar <strong>corrisposto mediante pagamento</strong> che il Cliente/Committente \n    avr cura di accendere come <strong>soluzione sottoscritta nel contratto</strong>, con conseguente \n    pagamento dell'indicato importo <strong>in ununica soluzione</strong> o <strong>a rate</strong>, \n    per come prestabilito nel contratto.\n  </p>\n\n  <p>\n    Resta inteso che, in caso di <strong>inerzia da parte del Cliente</strong>, potr essere emesso un \n    <strong>rimborso entro 30 giorni</strong> dalla firma del contratto e avvenuto pagamento.\n  </p>\n\n</div>
