nt-size: 48px; margin-bottom: 40px;">PACCHETTO BONUS COMPLETO</h1>\n\n  <p>\n    Il servizio "Turbo + Orbitale" include tutti i bonus di entrambi i percorsi, creando un'offerta di valore ineguagliabile e garantendo un supporto totale sia sul fronte aziendale che su quello della finanza personale.\n  </p>\n\n  <hr style="margin: 30px 0;">\n\n  <h3 style="color: #555;">Bonus relativi alla Piattaforma "Turbo" (Crescita Aziendale)</h3>\n\n  <h3>BONUS #1: Setup Guidato "Pronti, Partenza, VIA!"</h3>\n  <ul style="margin-bottom: 30px;">\n    <li><strong>Cosa Include:</strong> Un nostro tecnico specializzato imposta l'80% della piattaforma per te, consegnandoti un sistema "chiavi in mano" pronto a generare risultati da subito.\n      <span style="color: green;"><strong>(Valore: 497)</strong></span>\n    </li>\n  </ul>\n\n  <h3>BONUS #2: Garanzia "Anti-Stress Tecnologico" con Formazione su Misura</h3>\n  <ul style="margin-bottom: 30px;">\n    <li><strong>Cosa Include:</strong> Una sessione di formazione live dedicata e registrata per te e il tuo team, per rendere tutti autonomi e sicuri nell'uso del software.\n      <span style="color: green;"><strong>(Valore: 797)</strong></span>\n    </li>\n  </ul>\n\n  <h3>BONUS #3: Piano di Crescita Personalizzato a 90 Giorni</h3>\n  <ul style="margin-bottom: 30px;">\n    <li><strong>Cosa Include:</strong> Una call strategica dedicata per definire insieme una roadmap su misura per il tuo ristorante, con obiettivi chiari e misurabili.\n      <span style="color: green;"><strong>(Valore: 1.497)</strong></span>\n    </li>\n  </ul>\n\n  <h3>BONUS #4: Acceleratore di Ritorno sull'Investimento (ROI)</h3>\n  <ul style="margin-bottom: 30px;">\n    <li><strong>Cosa Include:</strong> Ti guideremo passo dopo passo nella creazione della tua prima campagna di marketing per generare i primi incassi extra direttamente con il nostro aiuto.\n      <span style="color: green;"><strong>(Valore: 997)</strong></span>\n    </li>\n  </ul>\n\n  <h3>BONUS #5: Consulenza Strategica Mensile "Check-Point Crescita" (12 Consulenze)</h3>\n  <ul style="margin-bottom: 30px;">\n    <li><strong>Cosa Include:</strong> Una consulenza strategica individuale ogni mese, per 12 mesi, per analizzare i dati, identificare opportunit e massimizzare i risultati di Turbo.\n      <span style="color: green;"><strong>(Valore: Almeno 2.997)</strong></span>\n    </li>\n  </ul>\n\n  <hr style="margin: 30px 0;">\n\n  <h3 style="color: #555;">Bonus relativi al Percorso "Orbitale" (Crescita Patrimonio Personale)</h3>\n\n  <h3>BONUS #6: Il Piano "Libert Finanziaria 2K" Personalizzato (12 Consulenze Finanziarie)</h3>\n  <ul style="margin-bottom: 30px;">\n    <li><strong>Cosa Include:</strong> 12 consulenze individuali con un nostro ESPERTO FINANZIARIO per costruire il tuo piano strategico verso la rendita passiva.\n      <span style="color: blue;"><strong>(Valore: Almeno 4.997)</strong></span>\n    </li>\n  </ul>\n\n  <h3>BONUS #7: Accesso al Software di Pianificazione Finanziaria "Orbitale Planner"</h3>\n  <ul style="margin-bottom: 30px;">\n    <li><strong>Cosa Include:</strong> Il tuo cruscotto digitale personale per monitorare e pianificare la crescita del tuo patrimonio.\n      <span style="color: blue;"><strong>(Valore: 1.997)</strong></span>\n    </li>\n  </ul>\n\n  <h3>BONUS #8: Accesso all'Accademia "Ristoratore Investitore"</h3>\n  <ul style="margin-bottom: 30px;">\n    <li><strong>Cosa Include:</strong> Formazione online chiara e pratica, pensata per imprenditori, per prendere decisioni finanziarie intelligenti.\n      <span style="color: blue;"><strong>(Valore: 997)</strong></span>\n    </li>\n  </ul>\n\n  <h3>BONUS #9: I Simulatori di Crescita Patrimoniale</h3>\n  <ul style="margin-bottom: 30px;">\n    <li><strong>Cosa Include:</strong> Strumenti interattivi per visualizzare l'impatto delle tue scelte finanziarie e accelerare il tuo percorso.\n      <span style="color: blue;"><strong>(Valore: 497)</strong></span>\n    </li>\n  </ul>\n\n</div>	<div style="line-height: 1.8; font-size: 16px; color: #333; margin-top: 30px;">\n\n  <p>\n    sar <strong>corrisposto mediante pagamento</strong> che il Cliente/Committente \n    avr cura di accendere come <strong>soluzione sottoscritta nel contratto</strong>, con conseguente \n    pagamento dell'indicato importo <strong>in ununica soluzione</strong> o <strong>a rate</strong>, \n    per come prestabilito nel contratto.\n  </p>\n\n  <p>\n    Resta inteso che, in caso di <strong>inerzia da parte del Cliente</strong>, potr essere emesso un \n    <strong>rimborso entro 30 giorni</strong> dalla firma del contratto e avvenuto pagamento.\n  </p>\n\n</div>
